import React, {useContext} from 'react';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Main from "../pages/Main";
import InfoProduct from "../pages/InfoProduct";
import Admin from "../pages/Admin";
import CreateDevice from "../pages/CreateDevice";
import PageError from "../pages/PageError";
import {useSelector} from "react-redux";
import {AuthContext} from "../context/context";
import {privateRoutes, publicRoutes} from "../routes/Routing";

const AppRouting = () => {
    const cards = useSelector(state => state.getCard.items);

    const [auth, setAuth] = useContext(AuthContext)

    return (
        <BrowserRouter>
            <Routes>
                {auth ? privateRoutes.map(rout => <Route path={rout.path} element={rout.element}
                                                         key={rout.id}/>) : publicRoutes.map(rout => <Route
                    path={rout.path} element={rout.element} key={rout.id}/>)}
                {/*<Route path="/" element={<Main/>}></Route>*/}
                {/*{cards.map(item => <Route path="products/:id" element={<InfoProduct/>}></Route>)}*/}
                {/*<Route path="/admin" element={<Admin/>}></Route>*/}
                {/*<Route path="/create" element={<CreateDevice/>}></Route>*/}
                {/*<Route path="*" element={<PageError/>}></Route>*/}

            </Routes>
        </BrowserRouter>
    );
};

export default AppRouting;
